import React from "react";
import { getAttendanceRateBySignupDate } from "features/singleMeetingAnalysis/SingleMeetingAnalysisUtils";
import { AttendeeData } from "features/singleMeetingAnalysis/SingleMeetupTypes";
import PercentageProgressBar from "./PercentageProgressBar";

type Props = {
  attendees: AttendeeData[];
  eventDate: string;
};
const AttendanceBySignupDate = ({ attendees, eventDate }: Props) => {
  const attendanceRateByDate = getAttendanceRateBySignupDate(
    attendees,
    eventDate
  );
  console.log("attendanceRateByDate", attendanceRateByDate);
  return (
    <div>
      <h3>Attendance By Signup Date</h3>
    </div>
  );
};

export default AttendanceBySignupDate;
